Lang.Menus.sw_contents_one = "This textbook allows elementary students to experience physical computing over a 5-lesson course. Students learn how to use ENTRY, and create images and stories. In the final section, students use Arduino as a learning tool and get to try their hands at creating a keyboard. ";
Lang.Menus.sw_camp_detail = "Ministry of Science, ICT and Future Planning Software Creation Camp";
Lang.Menus.sw_contents_two = "This textbook allows middle school students to experience ENTRY and physical computing over a 5-lesson course. Students learn how to use ENTRY, and create a maze game and quiz program. In the final section, students use Arduino and keyboard to steer a car.";
Lang.Menus.sw_contents_three = "This is a teacher’s guide for starting computing classes in schools.  It contains a variety of unplugged activities and lesson plans using clips from ‘Let’s play, Software!’broadcasts. ";
Lang.Menus.naver_sw = "NAVER Let’s play, Software!";
Lang.Menus.teacher_teaching = "Teacher’s Guide (for elementary grades 5-6 and above)";
Lang.Menus.funny_sw = "Have Fun with Software";
Lang.Menus.sw_contents_four = "This textbook allows students to learn about computing in a fun and playful way through a variety of unplugged activities such as ENTRY Board, and teaches students the basic principles of programming via ENTRY Course Mode. Once they have got down the basics, students learn how to create stories, games, artistic works, and applications using ENTRY. The textbook allows students to create and present their own software. ";
Lang.Menus.ct_text_5 = "Grow computational thinking with textbooks.";
Lang.Menus.teacher_grade_5 = "교원 (초등학교 5학년)";
Lang.Menus.ct_text_5_content = "This is a teaching guide containing 8 contents of real-life problem solving process. Each contents are designed to meet and solve various subject matter problems reflecting revised National curriculum. To help children cultivate computational thinking, try it right now!";
Lang.Menus.ct_text_6 = "교과서와 함께 키우는 컴퓨팅 사고력";
Lang.Menus.teacher_grade_6 = "교원 (초등학교 6학년)";
Lang.Menus.ct_text_6_content = "실생활의 문제를 해결하자는 테마로 준비된 총 8개의 학습콘텐츠가 담긴 교사용 지도안입니다. 각 콘텐츠는 개정된 교육과정을 반영한 타교과와의 연계를 통해 다양한 문제를 만나고 해결해볼 수 있도록 설계되었습니다.  아이들이 컴퓨팅 사고력을 갖춘 융합형 인재가 될 수 있도록 지금 적용해보세요!";
