Lang.Menus.the_great_escape = "The Great Escape";
Lang.Menus.escape_guide_1 = "ENTRY Bot suddenly began to think for himself during a power failure at the robot dog factory! ";
Lang.Menus.escape_guide_1_2 = " Help ENTRY Bot escape the factory and find his freedom!";
Lang.Menus.escape_guide_2 = "ENTRY Bot is missing too many parts to make it far. Help him find his parts as he makes his way out the factory!";
Lang.Menus.escape_guide_2_2 = "Objectives: Sequential Execution";
Lang.Menus.escape_guide_3 = "I’ve finally escaped the factory! But it’s still a long way to the village. I think I’m fixed up enough to make it there without too much difficulty. Hey, what’s that robot?";
Lang.Menus.escape_guide_3_2 = "Objectives: Repetitive and Conditional Statements";
Lang.Menus.escape_guide_4 = "We’re finally getting close to the village! I’m starting to really get the hang of this! I think it might be better to just use the blocks from memory. If I just recharge my battery here, I’ll be able to live free forever.";
Lang.Menus.escape_guide_4_2 = "Objectives: Definitions of Function and Function Call";
Lang.Menus.space_travel_log = "Space Travel Log";
Lang.Menus.space_guide_1 = "ENTRY Bot has finally completed his exploration of distant space. He’s trying to make his way back home to Earth, but his path is being blocked by a bunch of space rocks! Help ENTRY Bot make it back to Earth safely!";
Lang.Menus.space_guide_2 = "It’s finally time to return to Earth! I can’t wait to get back and rest! Tell me the positions of the rocks ahead so I can navigate through them! I’ll go the way you tell me to!";
Lang.Menus.space_guide_2_2 = "Objective: Reiterating IF Statements and Logical Operation";
Lang.Menus.cfest_mission = "ENTRY Experiential Mission";
Lang.Menus.maze_1_intro = "Hi. I’m ENTRY Bot. I’m about to save my injured friends and I need your help. Help me save my friends! First, set up the ‘Move forward one space’ block and press ‘Start’.";
Lang.Menus.maze_1_title = "How to Start";
Lang.Menus.maze_1_content = "How do I move ENTRY Bot?";
Lang.Menus.maze_1_detail = "1. Take a block from the Block Box and connect it with the ‘When Start is pressed’ block. <br> 2. Press Start once you have finished assembling. <br> 3. I will move in the order of your assembled blocks from top to bottom. ";
Lang.Menus.maze_2_intro = "Alright! You’ve saved the first of my friends! Now let’s save my next friend. Oh! There’s a beehive in the way! Use the Jump Over block to avoid the beehive and save my friend!";
Lang.Menus.maze_2_title_1 = "Jump Over";
Lang.Menus.maze_2_content_1 = "How do I get around obstacles?";
Lang.Menus.maze_2_detail_1 = "Sometimes your path may be blocked by an obstacle. <br> When there’s an obstacle in your path, you need to use the ‘Jump Over’ block.";
Lang.Menus.maze_2_title_2 = "How to Start";
Lang.Menus.maze_2_content_2 = "How do I move ENTRY Bot?";
Lang.Menus.maze_2_detail_2 = "1. Take a block from the Block Box and connect it with the ‘When Start is pressed’ block. <br> 2. Press Start once you have finished assembling. <br> 3. I will move in the order of your assembled blocks from top to bottom. ";
Lang.Menus.maze_3_intro = "Awesome! Now let’s go save another friend! How about we use the ‘Repeat’ block that my other friend gave use? You can easily repeat the same movements over again using the ‘Repeat’ block! Try changing the number of times to repeat. ";
Lang.Menus.maze_3_title = "Repeat Block (1)";
Lang.Menus.maze_3_content = "How do I use the ‘Repeat (3)’ block?";
Lang.Menus.maze_3_detail = "To perform the same action/s more than once, you need to use the ‘Repeat’ block. <br> Put the blocks that you want to repeat inside the Repeat box and select the number of times you want to repeat.";
Lang.Menus.maze_4_intro = "Super! Not too many robot friends left to save now. Take us to my friend by using the ‘Jump Over’ block on repeat while also evading the beehive!";
Lang.Menus.maze_4_title = "Repeat Block (1)";
Lang.Menus.maze_4_content = "How do I use the ‘Repeat (3)’ block?";
Lang.Menus.maze_4_detail = "To perform the same action/s more than once, you need to use the ‘Repeat’ block. <br> Put the blocks that you want to repeat inside the Repeat box and select the number of times you want to repeat.";
Lang.Menus.maze_5_intro = "Cool! Now let’s try using the ‘Repeat’ block and ‘IF’ block together! Using the ‘IF’ block, you can turn in a direction where there are no walls when you come across a wall. Well then, shall we set off to save my friend?";
Lang.Menus.maze_5_title_1 = "IF block";
Lang.Menus.maze_5_content_1 = "How does the ‘IF’ block work?";
Lang.Menus.maze_5_detail_1 = "You can determine what action to take when you come across a {IMAGE}. <br> The blocks are used only when you come across a {IMAGE}. <br> If there is none, the block is not used.";
Lang.Menus.maze_5_title_2 = "Repeat Block (2)";
Lang.Menus.maze_5_content_2 = "How do I use the ‘Repeat until’block?";
Lang.Menus.maze_5_detail_2 = "Using the ‘Repeat until’block, you can determine until when a specified action is repeated. <br> Just put the blocks you want to repeat inside the ‘Repeat until’ block. <br> Then, the repetition will stop when you reach the space where the {IMAGE} is located. ";
Lang.Menus.maze_6_intro = "Only one friend left! Just do as we’ve practiced and you’ll succeed! Now, let’s go save him!";
Lang.Menus.maze_6_title_1 = "IF block";
Lang.Menus.maze_6_content_1 = "How does the ‘IF’ block work?";
Lang.Menus.maze_6_detail_1 = "You can determine what action to take when you come across a {IMAGE}. <br> The blocks are used only when you come across a {IMAGE}. <br> If there is none, the block is not used.";
Lang.Menus.maze_6_title_2 = "Repeat Block (2)";
Lang.Menus.maze_6_content_2 = "How do I use the ‘Repeat until’block?";
Lang.Menus.maze_6_detail_2 = "Using the ‘Repeat until’block, you can determine until when a specified action is repeated. <br> Just put the blocks you want to repeat inside the ‘Repeat until’ block. <br> Then, the repetition will stop when you reach the space where the {IMAGE} is located. ";
Lang.Menus.maze_programing_mode_0 = "Block Coding";
Lang.Menus.maze_programing_mode_1 = "Javascript";
Lang.Menus.maze_operation1_title = "1단계 – 자바스크립트모드 안내";
Lang.Menus.maze_operation1_1_desc = "나는 로봇강아지 엔트리봇이야. 나에게 명령을 내려서 미션을 해결할 수 있게 도와줘! 미션은 시작할 때마다 <span class=\"textShadow\">\'목표\'</span>를 통해서 확인할 수 있어!";
Lang.Menus.maze_operation1_2_desc = "미션을 확인했다면 <b>명령</b>을 내려야 해 <span class=\"textUnderline\">\'명령어 꾸러미\'</span>는 <b>명령어</b>가 있는 공간이야. <b>마우스</b>와 <b>키보드</b>로 <b>명령</b>을 내릴 수 있어. <span class=\"textShadow\">마우스</span>로는 명령어 꾸러미에 있는 <b>명령어</b>를 클릭하거나, <b>명령어</b>를 <span class=\"textUnderline\">\'명령어 조립소\'</span>로 끌고와서 나에게 <b>명령</b>을 내릴 수 있어!";
Lang.Menus.maze_operation1_2_textset_1 = "마우스로 명령어를 클릭하는 방법 ";
Lang.Menus.maze_operation1_2_textset_2 = "마우스로 명령어를 드래그앤드랍하는 방법 ";
Lang.Menus.maze_operation1_3_desc = "<span class=\"textShadow\">키보드</span>로 명령을 내리려면 \'명령어 꾸러미\' 에 있는 <b>명령어를 키보드로 직접 입력하면 돼.</b></br> 명령어를 입력할 때 명령어 끝에 있는 <span class=\"textShadow\">()와 ;</span> 를 빼먹지 않도록 주의해야해!";
Lang.Menus.maze_operation1_4_desc = "미션을 해결하기 위한 명령어를 다 입력했다면 <span class=\"textShadow\">[시작하기]</span>를 누르면 돼.</br> [시작하기]를 누르면 나는 명령을 내린대로 움직일 거야!</br> 각 명령어가 궁금하다면 <span class=\"textShadow\">[명령어 도움말]</span>을 확인해봐!";
Lang.Menus.maze_operation7_title = "7단계 - 반복 명령 알아보기(횟수반복)";
Lang.Menus.maze_operation7_1_desc = "<b>똑같은 일</b>을 반복해서 명령하는건 매우 귀찮은 일이야.</br>이럴땐 <span class=\"textShadow\">반복</span>과 관련된 명령어를 사용하면 훨씬 쉽게 명령을 내릴 수 있어.";
Lang.Menus.maze_operation7_2_desc = "그렇다면 반복되는 명령을 쉽게 내리는 방법을 알아보자.</br>먼저 반복하기 명령어를 클릭한 다음, <span class=\"textShadow\">i<1</span> 의 숫자를 바꿔서 <span class=\"textShadow\">반복횟수</span>를 정하고</br><span class=\"textShadow\">괄호({ })</span> 사이에 반복할 명령어를 넣어주면 돼!";
Lang.Menus.maze_operation7_3_desc = "예를 들어 이 명령어<span class=\"textBadge number1\"></span>은 move(); 를 10번 반복해서 실행해.</br><span class=\"textBadge number2\"></span>명령어와 동일한 명령어지.";
Lang.Menus.maze_operation7_4_desc = "이 명령어를 사용할 때는 <span class=\"textShadow\">{ } 안에 반복할 명령어</span>를 잘 입력했는지,</br><span class=\"textShadow\">`;`</span>는 빠지지 않았는지 잘 살펴봐!</br>이 명령어에 대한 자세한 설명은 [명령어 도움말]에서 볼 수 있어.";
Lang.Menus.maze_operation7_1_textset_1 = "똑같은 명령어를 반복해서 사용하는 경우";
Lang.Menus.maze_operation7_1_textset_2 = "반복 명령어를 사용하는 경우";
Lang.Menus.maze_operation7_2_textset_1 = "반복 횟수";
Lang.Menus.maze_operation7_2_textset_2 = "반복할 명령";
Lang.Menus.maze_operation7_4_textset_1 = "괄호({})가 빠진 경우";
Lang.Menus.maze_operation7_4_textset_2 = "세미콜론(;)이 빠진 경우";
Lang.Menus.maze_operation9_title = "9단계 - 반복 명령 알아보기(조건반복)";
Lang.Menus.maze_operation9_1_desc = "앞에서는 몇 번을 반복하는 횟수반복 명령어에 대해 배웠어.</br>이번에는 <span class=\"textShadow\">계속해서 반복하는 명령어</span>를 살펴보자.</br>이 명령어를 사용하면 미션이 끝날 때까지 <b>동일한 행동</b>을 계속 반복하게 돼.</br>이 명령어 역시 괄호({ }) 사이에 반복할 명령어를 넣어 사용할 수 있어!";
Lang.Menus.maze_operation9_2_desc = "예를 들어 이 명령어 <span class=\"textBadge number1\"></span>은 미션을 완료할때까지 반복해서 move(); right()를 실행해.</br><span class=\"textBadge number2\"></span>명령어와 동일한 명령어지.";
Lang.Menus.maze_operation9_3_desc = "이 명령어를 사용할 때도 <span class=\"textShadow\">{ } 안에 반복할 명령어</span>를 잘 입력했는지,</br><span class=\"textShadow\">`true`</span>가 빠지지 않았는지 잘 살펴봐!</br>이 명령어에 대한 자세한 설명은 [명령어 도움말]에서 볼 수 있어.";
Lang.Menus.maze_operation9_1_textset_1 = "반복할 명령";
Lang.Menus.maze_operation9_3_textset_1 = "괄호({})가 빠진 경우";
Lang.Menus.maze_operation9_3_textset_2 = "세미콜론(;)이 빠진 경우";
Lang.Menus.maze_operation10_title = "10단계 - 조건 명령 알아보기";
Lang.Menus.maze_operation10_1_desc = "앞에서는 미션이 끝날 때까지 계속 반복하는 반복 명령어에 대해 배웠어.</br>이번에는 특정한 조건에서만 행동을 하는 <span class=\"textShadow\">조건 명령어</span>를 살펴보자.</br><span class=\"textBadge number2\"></span>에서 보는것처럼 조건 명령어를 사용하면 <b>명령을 보다 효율적으로 잘 내릴 수 있어.</b>";
Lang.Menus.maze_operation10_2_desc = "조건 명령어는 크게 <span class=\"textShadow\">`조건`</span> 과 <span class=\"textShadow\">`조건이 발생했을때 실행되는 명령`</span>으로 나눌수 있어.</br>먼저 <span class=\"textUnderline\">조건</span> 부분을 살펴보자. If 다음에 나오는 <span class=\"textUnderline\">( ) 부분</span>이 조건을 입력하는 부분이야.</br><span class=\"textBadge number1\"></span>과 같은 명령어를 예로 살펴보자. <span class=\"textUnderline\">if(front == \“wall\”)</span> 는 만약 내 앞에(front) \"wall(벽)\"이 있다면을 뜻해";
Lang.Menus.maze_operation10_3_desc = "이제 <span class=\"textUnderline\">`조건이 발생했을 때 실행되는 명령`</span>을 살펴보자.</br>이 부분은 <span class=\"textShadow\">괄호{}</span>로 묶여 있고, 조건이 발생했을때 괄호안의 명령을 실행하게 돼!</br>조건이 발생하지 않으면 이 부분은 무시하고 그냥 넘어가게 되지.</br><span class=\"textBadge number1\"></span>의 명령어를 예로 살펴보자. 조건은 만약에 `내 앞에 벽이 있을 때` 이고,</br><b>이 조건이 발생했을 때 나는 괄호안의 명령어 right(); 처럼 오른쪽으로 회전하게 돼!</b>";
Lang.Menus.maze_operation10_4_desc = "<span class=\"textShadow\">조건 명령어</span>는 <span class=\"textShadow\">반복하기 명령어</span>와 함께 쓰이는 경우가 많아.</br>앞으로 쭉 가다가, 벽을 만났을때만 회전하게 하려면</br><span class=\"textUnderline pdb5\"><span class=\"textBadge number1\"></span><span class=\"textBadge number2\"></span><span class=\"textBadge number3\"></span>순서</span>와 같이 명령을 내릴 수 있지!";
Lang.Menus.maze_operation10_1_textset_1 = "<b>[일반명령]</b>";
Lang.Menus.maze_operation10_1_textset_2 = "<span class=\"textMultiline\">앞으로 2칸 가고</br>오른쪽으로 회전하고,</br>앞으로 3칸가고,</br>오른쪽으로 회전하고, 앞으로...</span>";
Lang.Menus.maze_operation10_1_textset_3 = "<b>[조건명령]</b>";
Lang.Menus.maze_operation10_1_textset_4 = "<span class=\"textMultiline\">앞으로 계속 가다가</br><span class=\"textEmphasis\">`만약에 벽을 만나면`</span></br>오른쪽으로 회전해~!</span>";
Lang.Menus.maze_operation10_2_textset_1 = "조건";
Lang.Menus.maze_operation10_2_textset_2 = "조건이 발생했을 때 실행되는 명령";
Lang.Menus.maze_operation10_3_textset_1 = "조건";
Lang.Menus.maze_operation10_3_textset_2 = "조건이 발생했을 때 실행되는 명령";
Lang.Menus.maze_operation10_4_textset_1 = "<span class=\"textMultiline\">미션이 끝날때 까지</br>계속 앞으로 간다.</span>";
Lang.Menus.maze_operation10_4_textset_2 = "<span class=\"textMultiline\">계속 앞으로 가다가,</br>만약에 벽을 만나면</span>";
Lang.Menus.maze_operation10_4_textset_3 = "<span class=\"textMultiline\">계속 앞으로 가다가,</br>만약에 벽을 만나면</br>오른쪽으로 회전한다.</span>";
Lang.Menus.maze_operation15_title = "15단계 - 함수 명령 알아보기";
Lang.Menus.maze_operation15_1_desc = "자주 사용하는 명령어들을 매번 입력하는건 매우 귀찮은 일이야.</br>자주 사용하는 <span class=\"textUnderline\">명령어들을 묶어서 이름</span>을 붙이고,</br><b>필요할 때마다 그 명령어 묶음을 불러온다면 훨씬 편리하게 명령을 내릴 수 있어!</b></br>이런 명령어 묶음을  <span class=\"textShadow\">`함수`</span>라고 해. 이제 함수 명령에 대해 자세히 알아보자.";
Lang.Menus.maze_operation15_2_desc = "함수 명령어는 명령어를 묶는 <b>`함수만들기` 과정</b>과,</br>묶은 명령어를 필요할 때 사용하는 <b>`함수 불러오기` 과정</b>이 있어.</br>먼저 함수만들기 과정을 살펴보자.</br>함수를 만들려면 함수의 이름과, 그 함수에 들어갈 명령어를 입력해야 해.</br><span class=\"textShadow\">function</span>을 입력한 다음 <span class=\"textShadow\">함수의 이름</span>을 정할 수 있어. 여기서는 <span class=\"textShadow\">promise</span>로 만들거야.</br>함수 이름을 만들었으면 <span class=\"textUnderline\">()</span>를 붙여줘. 그 다음 <span class=\"textUnderline\">괄호({})</span>를 입력해.</br>그리고 <span class=\"textUnderline\">이 괄호 안에 함수에 들어갈 명령어들을 입력하면</span> 함수가 만들어져!";
Lang.Menus.maze_operation15_3_desc = "이 명령어를 예로 살펴보자. 나는 <span class=\"textShadow\">promise</span> 라는 함수를 만들었어.</br>이 함수를 불러서 실행하면 <span class=\"textUnderline\">괄호({})</span>안에 있는</br>move();</br>move();</br>left(); 가 실행돼!";
Lang.Menus.maze_operation15_4_desc = "함수를 불러와서 실행하려면 아까 만든 <b>함수의 이름을 입력하고 뒤에 `();`를 붙이면 돼.</b></br>promise 라는 이름으로 함수를 만들었으니 <span class=\"textShadow\">promise();</span> 를 입력하면 앞에서 묶어놓은</br>명령어들이 실행되는거지!</br><span class=\"number1 textBadge\"></span>과 같이 명령을 내리면 <span class=\"number2 textBadge\"></span>처럼 동작하게 돼!</br>함수 명령어를 사용하려면 <span class=\"number1 textBadge\"></span>과 같이 함수를 만들고 함수를 불러와야해!";
